import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'searchproducts'
})
export class SearchproductsPipe implements PipeTransform {

  transform(value: any, key:any): any {
    console.log(value);
    let result = value.filter((p:any)=>p.title.startswith(key.toLowerCase()));
    return result;
  }

}
